import React from 'react';

import logo180 from '../assets/logo180.png';

export class Sidebar extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="w-64 h-full bg-red-50 flex flex-col">
                <a href="/">
                        <img src={logo180} alt="logo" 
                            className="
                                mx-auto
                                h-16 py-3
                                block
                            "
                        />
                </a>
                <h3>Search</h3>
                <h3>Community Board</h3>
                <h3>Useful tools</h3>
                <h3>Trending</h3>


            </div>

        )
    }
}
